import React from 'react'
import '../container/leftdiv.css';
import logo from './logo.png';
import Content from './Content';

function Leftdiv() {
  return (
    <div className='left'>
           
           <img id='logo' src={logo} alt="Logo" width={100} />
            <h1 id='course-name'>Data Science</h1>
            <div>
            <Content/>
            </div>
  </div>

  )
}

export default Leftdiv
